import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as e,c as t,d as r}from"./app.a3d402e1.js";var d="/assets/software.jpg";const i={},h=r('<div class="custom-container tip"><p class="custom-container-title">\u524D\u8A00</p><p>\u8F6F\u4EF6\u7248\u672C\u5468\u671F\u662F\u6307\u8BA1\u7B97\u673A\u8F6F\u4EF6\u7684\u53D1\u5C55\u53CA\u53D1\u884C\u8FC7\u7A0B, \u4ECE Pre-alpha\uFF08\u51C6\u9884\u89C8\u7248\u672C\uFF09\u53D1\u5C55\u5230 Alpha\uFF08\u9884\u89C8\u7248\u672C\uFF09\u3001Beta\uFF08\u6D4B\u8BD5\u7248\u672C\uFF09\u3001Released candidate \uFF08\u6700\u7EC8\u6D4B\u8BD5\u7248\u672C\uFF09\u81F3\u6700\u540E\u7684 Gold\uFF08\u5B8C\u6210\u7248\uFF09\u3002</p></div><h2 id="\u4E00\u5F20\u56FE\u8BE0\u91CA\u53D1\u5C55\u8F6F\u4EF6\u7684\u8FC7\u7A0B" tabindex="-1"><a class="header-anchor" href="#\u4E00\u5F20\u56FE\u8BE0\u91CA\u53D1\u5C55\u8F6F\u4EF6\u7684\u8FC7\u7A0B" aria-hidden="true">#</a> \u4E00\u5F20\u56FE\u8BE0\u91CA\u53D1\u5C55\u8F6F\u4EF6\u7684\u8FC7\u7A0B</h2><p><img src="'+d+'" alt="software-version"></p><h2 id="\u5F00\u53D1\u671F" tabindex="-1"><a class="header-anchor" href="#\u5F00\u53D1\u671F" aria-hidden="true">#</a> \u5F00\u53D1\u671F</h2><h3 id="pre-alpha" tabindex="-1"><a class="header-anchor" href="#pre-alpha" aria-hidden="true">#</a> Pre-alpha</h3><p>\u6709\u65F6\u5019\u8F6F\u4EF6\u4F1A\u5728 Alpha \u6216 Beta \u7248\u672C\u524D\u5148\u53D1\u5E03 Pre-alpha \u7248\u672C\u3002\u4E00\u822C\u800C\u8A00\u76F8\u5BF9\u4E8E Alpha \u6216 Beta \u7248\u672C, Pre-alpha \u7248\u672C\u662F\u4E00\u4E2A\u529F\u80FD\u4E0D\u5B8C\u6574\u7684\u7248\u672C</p><h3 id="alpha" tabindex="-1"><a class="header-anchor" href="#alpha" aria-hidden="true">#</a> Alpha</h3><p>Alpha \u7248\u672C\u4ECD\u7136\u9700\u8981\u6D4B\u8BD5, \u5176\u529F\u80FD\u4EA6\u672A\u5B8C\u5584, \u56E0\u4E3A\u5B83\u662F\u6574\u4E2A\u8F6F\u4EF6\u53D1\u5E03\u5468\u671F\u4E2D\u7684\u7B2C\u4E00\u4E2A\u9636\u6BB5, \u6240\u4EE5\u5B83\u7684\u540D\u79F0\u662F&quot;Alpha&quot;, \u5E0C\u814A\u5B57\u6BCD\u4E2D\u7684\u7B2C\u4E00\u4E2A\u5B57\u6BCD&quot;\u03B1&quot;\u3002</p><p>Alpha \u7248\u672C\u901A\u5E38\u4F1A\u9001\u5230\u5F00\u53D1\u8F6F\u4EF6\u7684\u7EC4\u7EC7\u6216\u67D0\u7FA4\u4F53\u4E2D\u7684\u8F6F\u4EF6\u6D4B\u8BD5\u8005\u4F5C\u5185\u90E8\u6D4B\u8BD5\u3002\u5728\u5E02\u573A\u4E0A, \u8D8A\u6765\u8D8A\u591A\u516C\u53F8\u4F1A\u9080\u8BF7\u5916\u90E8\u5BA2\u6237\u6216\u5408\u4F5C\u4F19\u4F34\u53C2\u4E0E\u5176\u6D4B\u8BD5\u3002\u8FD9\u4EE4\u8F6F\u4EF6\u5728\u6B64\u9636\u6BB5\u6709\u66F4\u5927\u7684\u53EF\u7528\u6027\u6D4B\u8BD5\u3002</p><p>\u5728\u6D4B\u8BD5\u7684\u7B2C\u4E00\u4E2A\u9636\u6BB5\u4E2D, \u5F00\u53D1\u8005\u901A\u5E38\u4F1A\u8FDB\u884C\u767D\u76D2\u6D4B\u8BD5\u3002\u5176\u4ED6\u6D4B\u8BD5\u4F1A\u5728\u7A0D\u540E\u65F6\u95F4\u7531\u5176\u4ED6\u6D4B\u8BD5\u56E2\u4F53\u4EE5\u9ED1\u76D2\u6216\u7070\u76D2\u6280\u672F\u8FDB\u884C, \u4E0D\u8FC7\u6709\u65F6\u4F1A\u540C\u65F6\u8FDB\u884C\u3002</p><h3 id="beta" tabindex="-1"><a class="header-anchor" href="#beta" aria-hidden="true">#</a> Beta</h3><p>Beta \u7248\u672C\u662F\u8F6F\u4EF6\u6700\u65E9\u5BF9\u5916\u516C\u5F00\u7684\u8F6F\u4EF6\u7248\u672C, \u7531\u516C\u4F17\uFF08\u901A\u5E38\u4E3A\u516C\u53F8\u5916\u7684\u7B2C\u4E09\u65B9\u5F00\u53D1\u8005\u548C\u4E1A\u4F59\u73A9\u5BB6\uFF09\u53C2\u4E0E\u6D4B\u8BD5\u3002 \u56E0\u4E3A\u662F Alpha \u7684\u4E0B\u4E00\u4E2A\u9636\u6BB5, \u6240\u4EE5\u4E3A\u5E0C\u814A\u5B57\u6BCD\u7684\u7B2C\u4E8C\u4E2A\u5B57 Beta (\u03B2)\u3002 \u4E00\u822C\u6765\u8BF4, Beta \u5305\u542B\u6240\u6709\u529F\u80FD, \u4F46\u53EF\u80FD\u6709\u4E00\u4E9B\u5DF2\u77E5\u95EE\u9898\u548C\u8F83\u8F7B\u5FAE\u7684\u7A0B\u5E8F\u9519\u8BEF\uFF08BUG\uFF09, \u8981\u8FDB\u884C\u9664\u9519\uFF08debug\uFF09\u3002Beta \u7248\u672C\u7684\u6D4B\u8BD5\u8005\u901A\u5E38\u662F\u5F00\u53D1\u8F6F\u4EF6\u7684\u7EC4\u7EC7\u7684\u5BA2\u6237, \u4ED6\u4EEC\u4F1A\u4EE5\u514D\u8D39\u6216\u4F18\u60E0\u4EF7\u94B1\u5F97\u5230\u8F6F\u4EF6\u3002Beta \u7248\u672C\u4EA6\u4F5C\u4E3A\u6D4B\u8BD5\u4EA7\u54C1\u7684\u652F\u6301\u548C\u5E02\u573A\u53CD\u5E94\u7B49\u3002</p><p>\u5176\u4ED6\u60C5\u51B5\u4E0D\u540C\u4F01\u4E1A\u6709\u4E0D\u540C\u7684\u79F0\u6CD5, \u4F8B\u5982\u5FAE\u8F6F\u66FE\u4EE5 Community Technology Preview\uFF08\u7B80\u79F0 CTP, \u4E2D\u6587\u79F0\u4E3A&quot;\u793E\u7FA4\u6280\u672F\u9884\u89C8&quot;\uFF09\u4E3A\u53D1\u5E03\u8F6F\u4EF6\u7684\u6D4B\u8BD5\u7248\u672C\u4E4B\u4E00, \u5FAE\u8F6F\u5C06\u8FD9\u4E2A\u9636\u6BB5\u7684\u8F6F\u4EF6\u6563\u5E03\u7ED9\u6709\u9700\u8981\u5148\u884C\u8BD5\u7528\u7684\u7528\u6237\u6216\u5382\u5546, \u5E76\u6536\u96C6\u8FD9\u4E9B\u4EBA\u7684\u4F7F\u7528\u7ECF\u9A8C, \u4EE5\u4FBF\u4F5C\u4E3A\u8FDB\u4E00\u6B65\u4FEE\u6B63\u8F6F\u4EF6\u7684\u53C2\u8003\u3002</p><h3 id="release-candidate" tabindex="-1"><a class="header-anchor" href="#release-candidate" aria-hidden="true">#</a> Release Candidate</h3><p>Release Candidate\uFF08\u7B80\u79F0 RC\uFF09\u6307\u53EF\u80FD\u6210\u4E3A\u6700\u7EC8\u4EA7\u54C1\u7684\u5019\u9009\u7248\u672C, \u5982\u679C\u672A\u51FA\u73B0\u95EE\u9898\u5219\u53EF\u53D1\u5E03\u6210\u4E3A\u6B63\u5F0F\u7248\u672C\u3002\u5728\u6B64\u9636\u6BB5\u7684\u4EA7\u54C1\u901A\u5E38\u5305\u542B\u6240\u6709\u529F\u80FD\u3001\u6216\u63A5\u8FD1\u5B8C\u6574, \u4EA6\u4E0D\u4F1A\u51FA\u73B0\u4E25\u91CD\u95EE\u9898\u3002</p><p>\u591A\u6570\u5F00\u6E90\u8F6F\u4EF6\u4F1A\u63A8\u51FA\u4E24\u4E2A RC \u7248\u672C, \u6700\u540E\u7684 RC2 \u5219\u6210\u4E3A\u6B63\u5F0F\u7248\u672C\u3002\u95ED\u6E90\u8F6F\u4EF6\u8F83\u5C11\u516C\u5F00\u4F7F\u7528, \u5FAE\u8F6F\u516C\u53F8\u5728 Windows 7 \u4E0A\u5E94\u7528\u6B64\u540D\u79F0\u3002\u82F9\u679C\u516C\u53F8\u628A\u5728\u8FD9\u9636\u6BB5\u7684\u4EA7\u54C1\u79F0\u4E3A&quot;Golden Master Candidate&quot;\uFF08\u7B80\u79F0 GM Candidate\uFF09, \u800C\u6700\u540E\u7684 GM \u5373\u6210\u4E3A\u6B63\u5F0F\u7248\u672C\u3002</p><h2 id="\u5B8C\u6210\u671F" tabindex="-1"><a class="header-anchor" href="#\u5B8C\u6210\u671F" aria-hidden="true">#</a> \u5B8C\u6210\u671F</h2><h3 id="release-to-manufacting-rtm" tabindex="-1"><a class="header-anchor" href="#release-to-manufacting-rtm" aria-hidden="true">#</a> Release to Manufacting, RTM</h3><p><code>\u751F\u4EA7\u5546\u53D1\u653E</code> \uFF08Release to Manufacturing, \u7F29\u5199 <code>RTM</code> \uFF09\u662F\u8F6F\u4EF6\u4EA7\u54C1\u51C6\u5907\u4EA4\u4ED8\u65F6\u4F7F\u7528\u7684\u672F\u8BED, \u6765\u81EA\u4E8E\u4EE5\u524D\u8FD8\u9700\u8981\u4F7F\u7528\u5B9E\u4F53\u8F7D\u5177\uFF08\u5149\u76D8, \u786C\u76D8\u7B49\uFF09\u6765\u8FDB\u884C\u5B89\u88C5\u7684\u65F6\u4EE3\u3002\u67D0\u4E9B\u8BA1\u7B97\u673A\u7A0B\u5E8F\u4EE5&quot;RTM&quot;\u4F5C\u4E3A\u8F6F\u4EF6\u7248\u672C\u4EE3\u53F7, \u4F8B\u5982\u5FAE\u8F6F Windows 7 \u53D1\u884C\u96F6\u552E\u7248\u524D\u7684 RTM \u7248\u672C\u4E3B\u8981\u662F\u53D1\u653E\u7ED9\u7EC4\u88C5\u673A\u751F\u4EA7\u5546\u7528, \u4F7F\u5236\u9020\u5546\u80FD\u591F\u63D0\u65E9\u8FDB\u884C\u96C6\u6210\u5DE5\u4F5C\u6216\u89E3\u51B3\u8F6F\u4EF6\u4E0E\u786C\u4EF6\u8BBE\u5907\u53EF\u80FD\u9047\u5230\u7684\u9519\u8BEF\u3002RTM \u7248\u672C\u5E76\u4E0D\u4E00\u5B9A\u610F\u5473\u7740\u521B\u4F5C\u8005\u89E3\u51B3\u4E86\u8F6F\u4EF6\u6240\u6709\u95EE\u9898\uFF1B\u4ECD\u6709\u53EF\u80FD\u5411\u516C\u4F17\u53D1\u5E03\u524D\u66F4\u65B0\u7248\u672C\u3002\u4EE5 Windows 7 \u4E3A\u4F8B: RTM \u7248\u4E0E\u96F6\u552E\u7248\u7684\u7248\u672C\u53F7\u662F\u4E00\u6837\u7684\u3002</p><h3 id="general-availability-ga" tabindex="-1"><a class="header-anchor" href="#general-availability-ga" aria-hidden="true">#</a> General availability, GA</h3><p><code>\u4E00\u822C\u53EF\u7528</code> \uFF08General availability, \u7F29\u5199 <code>GA</code> \uFF09\u662F\u6240\u6709\u5FC5\u8981\u7684\u5546\u4E1A\u6D3B\u52A8\u5DF2\u7ECF\u5B8C\u6210, \u8BE5\u8F6F\u4EF6\u4EA7\u54C1\u5DF2\u7ECF\u53EF\u4EE5\u53D1\u552E\u7684\u9636\u6BB5\u3002\u7136\u800C, \u8FD9\u53D6\u51B3\u4E8E\u8BED\u8A00\u3001\u5730\u57DF\u548C\u7535\u5B50\u8BBE\u5907\u4E0E\u5A92\u4F53\u7684\u53EF\u7528\u6027, \u6709\u4E9B\u5730\u533A\u4E4B\u95F4\u53EF\u80FD\u4F1A\u6709\u4E0A\u5E02\u65F6\u95F4\u7684\u5EF6\u8FDF\u3002\u5546\u4E1A\u6D3B\u52A8\u53EF\u80FD\u4E5F\u5305\u62EC\u5B89\u5168\u6027\u548C\u5408\u6CD5\u6D4B\u8BD5, \u4EE5\u53CA\u672C\u5730\u5316\u548C\u5168\u7403\u9500\u552E\u7684\u53EF\u80FD\u6027\u8BC4\u4F30\u3002RTM \u4E0E GA \u7684\u95F4\u9694\u53EF\u80FD\u4F1A\u662F 1 \u5468\u6216\u51E0\u4E2A\u6708, \u56E0\u4E3A\u5728\u6B64\u8FC7\u7A0B\u4E2D\u9700\u8981\u8FDB\u884C\u8BB8\u591A\u5546\u4E1A\u6D3B\u52A8\u3002\u5728\u8FD9\u4E2A\u9636\u6BB5, \u53EF\u4EE5\u8BF4\u8F6F\u4EF6\u5DF2\u7ECF&quot;\u4E0A\u7EBF&quot;\u4E86\u3002</p><h3 id="release-to-web-rtw" tabindex="-1"><a class="header-anchor" href="#release-to-web-rtw" aria-hidden="true">#</a> Release to Web, RTW</h3><p><code>\u7F51\u7EDC\u5206\u53D1</code> \uFF08Release to Web, \u7F29\u5199 <code>RTW</code> \uFF09, \u6216\u79F0 Web \u53D1\u5E03\u662F\u4E00\u79CD\u5229\u7528\u4E92\u8054\u7F51\u8FDB\u884C\u5206\u53D1\u7684\u8F6F\u4EF6\u4EA4\u4ED8\u65B9\u5F0F\u3002\u5236\u9020\u5546\u5728\u8FD9\u79CD\u7C7B\u578B\u7684\u53D1\u5E03\u4E2D\u5E76\u4E0D\u751F\u4EA7\u5B9E\u4F53\u8F6F\u4EF6\u5DE5\u5177, \u800C\u4F1A\u501F\u7531 OTA \u6765\u8FDB\u884C\u53D1\u653E\u3002\u968F\u7740\u4E92\u8054\u7F51\u4F7F\u7528\u4EBA\u6570\u7684\u589E\u957F, RTW \u53D8\u5F97\u8D8A\u6765\u8D8A\u666E\u904D\u3002</p><h3 id="stable" tabindex="-1"><a class="header-anchor" href="#stable" aria-hidden="true">#</a> Stable</h3><p><code>\u7A33\u5B9A\u7248\u672C</code> \u6765\u81EA\u9884\u89C8\u7248\u672C\u91CA\u51FA\u4F7F\u7528\u4E0E\u6539\u5584\u800C\u4FEE\u6B63\u5B8C\u6210, \u901A\u5E38\u662F\u521D\u59CB\u7248\u672C\u8FDB\u884C\u51E0\u4E2A\u5C0F\u66F4\u65B0\u540E\u7684\u7248\u672C\u3002\u4E3A\u76EE\u524D\u6240\u4F7F\u7528\u7684\u8F6F\u4EF6\u5728\u5339\u914D\u9700\u6C42\u89C4\u683C\u7684\u786C\u4EF6\u4E0E\u64CD\u4F5C\u7CFB\u7EDF\u4E2D\u8FD0\u884C\u4E0D\u4F1A\u9020\u6210\u4E25\u91CD\u7684\u4E0D\u517C\u5BB9\u6216\u662F\u786C\u4EF6\u51B2\u7A81, \u5176\u5DF2\u53D7\u8FC7\u67D0\u5B9A\u91CF\u7684\u6D4B\u8BD5\u65E0\u8BEF\u540E\u6240\u91CA\u51FA\u8005\u3002</p>',25),o=[h];function n(l,s){return e(),t("div",null,o)}var u=a(i,[["render",n],["__file","software-version-cycle.html.vue"]]);export{u as default};
